window.bookSummaryJSON = "<p>After accidentally killing the Grand High Witch of Edinburgh, enchantress investigator Elle Chambers is a marked woman. The coven wants vengeance. The magical world is watching. And Elle is once again caught in the crosshairs of supernatural politics.</p><p>On the run with werewolf legal advisor Ferguson Black, Elle finds herself drawn to London on a dangerous new case involving a threat to the royals. But London holds its own perils, and Elle must navigate a city steeped in witch-hunting history while staying one step ahead of those who want her dead.</p><p>Complicating matters, her partnership with Fergie is shifting into something deeper. His shocking secret—that he is not only a werewolf but also a warlock—forces Elle to confront her own power and the growing connection between them. As danger closes in and her enemies grow bolder, Elle must decide whom she can trust and what she’s willing to sacrifice to survive.</p><p><i>Witch List</i> is a captivating blend of mystery, romance, and magic in a world where power always comes at a price.</p><p><b>Click BUY NOW or READ FOR FREE to continue the Witch Detectives series of supernatural mysteries today!</b></p>"; 
